    return (
        <>
        <div className="home">
            <h1 className="heading">React Libraray</h1>
            <Button className='but'><Link to="/books">Books</Link></Button>
            <Button className='but'><Link to ="/add">Add</Link></Button>
            <Button className='but'><Link to ="/update">Update</Link></Button>
            </div>
        </>
    )
})
export default Home
